/*
拼音查询http://py.kdd.cc/color.js主页广告太多
导入data.js
*/
(function(){
if(!window.URL){
	throw new Error("浏览器版本太低");
};

var cityList=[],nameList=[],nameLength=0;;
function readName(data){
	for(var i=0;i<data.length;i++){
		if(!data[i].pinyin){
			var name=data[i].name.replace(/街道办事处/ig,"");
			nameLength+=name.length;
			
			nameList.push(name);
			cityList.push(data[i]);
		}
		readName(data[i].child);
	}
}
readName(CITY_LIST);
console.log("共"+nameLength+"字要拼音");

var loadPinyinID=0,loadPinyinTry=0;
function loadPinyin(True,False){
	loadPinyinTry++;
	if(loadPinyinTry>3){
		console.log("查询拼音失败超过3次");
		onFalse();
		return;
	}
	if(loadPinyinID>=nameList.length){
		console.log("--查询拼音完成--");
		loadPinyinID=0;
		loadPinyinTry=0;
		True();
		return;
	}
	console.log("查询"+loadPinyinID+"-"+(loadPinyinID+1000)+"字符拼音，共"+nameList.length);
	var names=[];
	for(var i=loadPinyinID,n=loadPinyinID+1000;i<n&&i<nameList.length;i++){
		names.push(nameList[i]);
	}
	
	function onFalse(){
		loadPinyinID=0;
		loadPinyinTry=0;
		False();
	}
	
	pinyin(names.join("$").replace(/娃/g,"挖").replace(/姥/g,"老").replace(/掇/g,"多").replace(/囊/g,"囔"),function(text){
		loadPinyinTry=0;
		
		var py=text.split("$");
		if(py.length==names.length){
			for(var i=0;i<py.length;i++){
				var pylist=py[i].replace(/^\s+|\s+$/ig,"").split(" ");
				if(pylist.length!=names[i].length){
					console.log("提示：拼音["+py[i]+"]数量和文字["+names[i]+"]不一致");
				}
				cityList[loadPinyinID+i].pinyin=pylist.join(" ");
				var prefix="";
				for(var j=0;j<pylist.length;j++){
					prefix+=pylist[j].charAt(0);
				}
				cityList[loadPinyinID+i].prefix=prefix;
			}
		}else{
			console.log("拼音数量不一致");
			console.log(py,names);
			onFalse();
			return;
		}
		
		loadPinyinID+=1000;
		loadPinyin(True,False);
	},function(){
		setTimeout(function(){loadPinyin(True,False)},15000);
	});
}

window.save=function(){
	var url=URL.createObjectURL(
		new Blob([new Uint8Array([0xEF,0xBB,0xBF]),"var CITY_LIST=",JSON.stringify(CITY_LIST,null,"\t")]
		,{"type":"text/plain"})
	);
	var downA=document.createElement("A");
	downA.innerHTML="下载查询好拼音的文件";
	downA.href=url;
	downA.download="data_pinyin.txt";
	document.body.appendChild(downA);
	downA.click();
}
window.load=function(){
	loadPinyin(function(){
		save();
		console.log("--结束,请及时下载--");
	},function(){
		console.log("--失败--");
	});
}
})();

//-------------------------------------

function pinyin(str,True,False){
	var code=AE.transcoding.paramEncode(str,"gbk");
	if(!code){
		False();
		return;
	}
	
	var ajax=new XMLHttpRequest();
	ajax.open("POST","http://py.kdd.cc/index.asp");
	ajax.setRequestHeader('Content-Type','application/x-www-form-urlencoded; charset=gbk');
	ajax.onreadystatechange=function(){
		if(ajax.readyState==4){
			if(ajax.status==200){
				var text=ajax.responseText;
				var idx=text.indexOf("<font color=_pinyin_>");
				var exp=/<br>/ig;
				exp.lastIndex=idx;
				var match=exp.exec(text);
				if(idx+1 && match){
					var py=text.substring(idx,match.index).replace(/<.+?>/ig,"").replace(/^\s+|\s+$/ig,"");
					True(py);
				}else{
					console.log("无结果");
					False();
				}
			}else{
				False();
			}
		}
	}
	ajax.send("zy=3&dy=red&ps=_pinyin_&zs=blue&kd=55&u=3&wz="+code+"&zh=%B2%E9%D1%AF%BA%BA%D7%D6%C6%B4%D2%F4%B2%A2%B1%EA%D7%A2++%28Ctrl+%2B+%BB%D8%B3%B5%BC%FC%29");
};

var AE={inArray:function(a,s){return a.indexOf(s)}};
AE.transcoding=(function(){

var Charset={}
,CharcodeData=(function(){
	var charcodeString={
		"GBK":{charset:["GB2312","GBK"],len:4,addAscii:true
			,data:""
			,"ucs":
			""
		}	
	};
	
	function parse(str,addAscii,len){
		var code=[],n=0,i,l=str.length;
		if(addAscii){
			for(i=0;i<256;i++){
				code.push(i);
			};
		};
		while(n<l){
			code.push(parseInt(str.substr(n,len),16));
			n+=len;
		};
		return code;
	};
	var data={},o,i,l,k;
	for(k in charcodeString){
		o=charcodeString[k];
		data[k]={data:parse(o.data,o.addAscii,o.len),ucs:parse(o.ucs,o.addAscii,4)};
		
		for(i=0,l=o.charset.length;i<l;i++){
			Charset[o.charset[i]]=k;
		};
	};
	charcodeString=null;
	return data;
})();

var transcoding={
	__AE:"transcoding"
	,Charset:Charset
	,CharcodeData:CharcodeData
	,Url:"http://www.58guakao.com/t559c0s0/1.html"
	,intToHex:function(code){
		var c=code.toString(16);
		return (c.length%2?"0":"")+c;
	}
	,intArrayToHex:function(arr){
		var val=[];
		for(var i=0,l=arr.length,c;i<l;i++){
			c=arr[i].toString(16);
			val.push((c.length%2?"0":"")+c);
		};
		return val.join("");
	}
	,splitHex:function(str,n){
		var val=[];
		for(var i=0;i<str.length;i+=n){
			val.push(str.substr(i,n));
		};
		return val;
	}
	,encode:function(ucsCode,data){
		var idx=AE.inArray(data.ucs,ucsCode);
		if(idx+1){
			return data.data[idx];
		}else{
			return 0;
		};
	}
	,decode:function(code,data){
		var idx=AE.inArray(data.data,code);
		if(idx+1){
			return String.fromCharCode(data.ucs[idx]);
		}else{
			return null;
		};
	}
	,paramEncode:function(str,charset){
		charset=charset.toUpperCase();
		var val="",charsetKey=this.Charset[charset];
		
		if(charsetKey){
			var charcode=[];
			var o=this.CharcodeData[charsetKey];
			
			for(var i=0,l=str.length,c,code;i<l;i++){
				c=str.charCodeAt(i);
				if(0x2F<c&&c<0x3A||0x40<c&&c<0x5B||0x60<c&&c<0x7B){
					charcode.push(str.charAt(i));
				}else{
					code=this.encode(c,o);
					if(!code){
						console.log(c+"无法识别为gbk")
						return "";
					};
					charcode.push("%"+this.splitHex(this.intToHex(code),2).join("%"));
				};
			};
			val=charcode.join("");
		}else{
			AE.load(this.Url,function(json){
					if(json.flag){
						val=json.data;
					};
				}).set("async",false).json().post(["type","urlEncode","data",str,"charset",charset]);
		};
		return val.toUpperCase();
	}
	,paramDecode:(function(){
		var exp=/(?:%[\da-f]{2})+/ig;
		return function(str,charset){
			charset=charset.toUpperCase();
			var val="",charsetKey=this.Charset[charset];
			if(charsetKey){
				var o=this.CharcodeData[charsetKey],This=this;
				
				val=str.replace(exp,function(s){
					var res=[],uint=[];
					
					uint.push.apply(uint,s.substr(1).split("%"));
					/*GBK only*/
					for(var i=0,l=uint.length,c,c1,c1x,c2;i<l;i++){
						c1=c1x=parseInt(uint[i++],16);
						if(i<l){
							c1=c1<<8;
							c2=parseInt(uint[i],16);
							c=This.decode(c1|c2,o);
							if(c!=null){
								res.push(c);
								continue;
							};
						};
						i--;
						c=String.fromCharCode(c1x);
						res.push(c);
					};
					return res.join("");
				});
			}else{
				AE.load(this.Url,function(json){
						if(json.flag){
							val=json.data;
						};
					}).set("async",false).json().post(["type","urlDecode","data",str,"charset",charset]);
			};
			return val;
		};
	})()
};

return transcoding;
})();